// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";

/**
 * @title SPayLater
 * @dev Smart contract cho hệ thống trả sau (BNPL - Buy Now Pay Later)
 */
contract SPayLater is Ownable, ReentrancyGuard, Pausable {

    // Struct định nghĩa thông tin khách hàng
    struct Customer {
        address walletAddress;
        uint256 creditLimit;        // Hạn mức tín dụng (VNĐ)
        uint256 availableCredit;    // Số dư khả dụng
        uint256 usedCredit;         // Số tiền đã sử dụng
        bool isActive;              // Tài khoản có hoạt động không
        uint256 totalTransactions;  // Tổng số giao dịch
        uint256 totalPaid;          // Tổng số tiền đã trả
        uint256 totalOverdue;       // Tổng số tiền quá hạn
    }

    // Struct định nghĩa giao dịch
    struct Transaction {
        uint256 id;
        address customer;
        uint256 amount;             // Số tiền (VNĐ)
        uint256 purchaseDate;       // Ngày mua
        uint256 dueDate;            // Ngày đến hạn thanh toán
        uint256 paidAmount;         // Số tiền đã trả
        TransactionStatus status;   // Trạng thái
        string orderId;             // ID đơn hàng
        string metadata;            // Thông tin bổ sung (JSON)
    }

    enum TransactionStatus {
        PENDING,        // Chờ thanh toán
        PARTIALLY_PAID, // Trả một phần
        PAID,           // Đã thanh toán đầy đủ
        OVERDUE,        // Quá hạn
        CANCELLED       // Đã hủy
    }

    // State variables
    mapping(address => Customer) public customers;
    mapping(uint256 => Transaction) public transactions;
    mapping(address => uint256[]) public customerTransactions;

    uint256 public transactionCounter;
    uint256 public constant DEFAULT_CREDIT_LIMIT = 2000000; // 2 triệu VNĐ
    uint256 public constant PAYMENT_PERIOD = 30 days;       // 30 ngày
    uint256 public constant LATE_FEE_RATE = 5;              // 5% phí trễ hạn

    // Events
    event CustomerRegistered(address indexed customer, uint256 creditLimit);
    event CreditLimitUpdated(address indexed customer, uint256 newLimit);
    event TransactionCreated(uint256 indexed transactionId, address indexed customer, uint256 amount);
    event PaymentMade(uint256 indexed transactionId, address indexed customer, uint256 amount);
    event TransactionCancelled(uint256 indexed transactionId);
    event LateFeeCharged(uint256 indexed transactionId, uint256 feeAmount);

    constructor(address initialOwner)
        Ownable(initialOwner)  // ⭐ BẮT BUỘC TRONG OZ V5
    {
        transactionCounter = 0;
    }

    /**
     * @dev Đăng ký khách hàng mới
     */
    function registerCustomer(address _customer) external onlyOwner {
        require(!customers[_customer].isActive, "Customer already registered");

        customers[_customer] = Customer({
            walletAddress: _customer,
            creditLimit: DEFAULT_CREDIT_LIMIT,
            availableCredit: DEFAULT_CREDIT_LIMIT,
            usedCredit: 0,
            isActive: true,
            totalTransactions: 0,
            totalPaid: 0,
            totalOverdue: 0
        });

        emit CustomerRegistered(_customer, DEFAULT_CREDIT_LIMIT);
    }

    /**
     * @dev Cập nhật hạn mức tín dụng
     */
    function updateCreditLimit(address _customer, uint256 _newLimit) external onlyOwner {
        require(customers[_customer].isActive, "Customer not active");

        Customer storage customer = customers[_customer];
        customer.creditLimit = _newLimit;
        customer.availableCredit = _newLimit - customer.usedCredit;

        emit CreditLimitUpdated(_customer, _newLimit);
    }

    /**
     * @dev Tạo giao dịch mới (khách hàng mua hàng trả sau)
     */
    function createTransaction(
        address _customer,
        uint256 _amount,
        string memory _orderId,
        string memory _metadata
    ) external onlyOwner whenNotPaused nonReentrant returns (uint256) {
        require(customers[_customer].isActive, "Customer not active");
        require(_amount > 0, "Amount must be greater than 0");
        require(customers[_customer].availableCredit >= _amount, "Insufficient credit");

        transactionCounter++;
        uint256 transactionId = transactionCounter;

        uint256 purchaseDate = block.timestamp;
        uint256 dueDate = purchaseDate + PAYMENT_PERIOD;

        transactions[transactionId] = Transaction({
            id: transactionId,
            customer: _customer,
            amount: _amount,
            purchaseDate: purchaseDate,
            dueDate: dueDate,
            paidAmount: 0,
            status: TransactionStatus.PENDING,
            orderId: _orderId,
            metadata: _metadata
        });

        // Cập nhật thông tin khách hàng
        Customer storage customer = customers[_customer];
        customer.usedCredit += _amount;
        customer.availableCredit -= _amount;
        customer.totalTransactions++;

        // Lưu transaction ID cho customer
        customerTransactions[_customer].push(transactionId);

        emit TransactionCreated(transactionId, _customer, _amount);

        return transactionId;
    }

    /**
     * @dev Thanh toán giao dịch
     */
    function makePayment(uint256 _transactionId) external payable nonReentrant {
        Transaction storage txn = transactions[_transactionId];
        require(txn.customer == msg.sender, "Not transaction owner");
        require(txn.status != TransactionStatus.PAID, "Already paid");
        require(txn.status != TransactionStatus.CANCELLED, "Transaction cancelled");

        uint256 paymentAmount = msg.value;
        uint256 remainingAmount = txn.amount - txn.paidAmount;

        // Kiểm tra nếu quá hạn, tính phí
        if (block.timestamp > txn.dueDate && txn.status != TransactionStatus.OVERDUE) {
            uint256 lateFee = (remainingAmount * LATE_FEE_RATE) / 100;
            txn.amount += lateFee;
            txn.status = TransactionStatus.OVERDUE;

            customers[msg.sender].totalOverdue += remainingAmount;

            emit LateFeeCharged(_transactionId, lateFee);
        }

        require(paymentAmount <= remainingAmount, "Payment exceeds remaining amount");

        // Cập nhật transaction
        txn.paidAmount += paymentAmount;

        if (txn.paidAmount >= txn.amount) {
            txn.status = TransactionStatus.PAID;
        } else {
            txn.status = TransactionStatus.PARTIALLY_PAID;
        }

        // Cập nhật customer
        Customer storage customer = customers[msg.sender];
        customer.totalPaid += paymentAmount;
        customer.usedCredit -= paymentAmount;
        customer.availableCredit += paymentAmount;

        if (txn.status == TransactionStatus.OVERDUE) {
            customer.totalOverdue -= paymentAmount;
        }

        emit PaymentMade(_transactionId, msg.sender, paymentAmount);
    }

    /**
     * @dev Hủy giao dịch (chỉ admin)
     */
    function cancelTransaction(uint256 _transactionId) external onlyOwner {
        Transaction storage txn = transactions[_transactionId];
        require(txn.status == TransactionStatus.PENDING, "Can only cancel pending transactions");

        // Hoàn lại credit cho customer
        Customer storage customer = customers[txn.customer];
        customer.usedCredit -= txn.amount;
        customer.availableCredit += txn.amount;

        txn.status = TransactionStatus.CANCELLED;

        emit TransactionCancelled(_transactionId);
    }

    /**
     * @dev Lấy thông tin khách hàng
     */
    function getCustomerInfo(address _customer) external view returns (
        uint256 creditLimit,
        uint256 availableCredit,
        uint256 usedCredit,
        uint256 totalTransactions,
        uint256 totalPaid,
        uint256 totalOverdue
    ) {
        Customer memory customer = customers[_customer];
        return (
            customer.creditLimit,
            customer.availableCredit,
            customer.usedCredit,
            customer.totalTransactions,
            customer.totalPaid,
            customer.totalOverdue
        );
    }

    /**
     * @dev Lấy danh sách transaction IDs của customer
     */
    function getCustomerTransactions(address _customer) external view returns (uint256[] memory) {
        return customerTransactions[_customer];
    }

    /**
     * @dev Lấy thông tin transaction
     */
    function getTransaction(uint256 _transactionId) external view returns (
        address customer,
        uint256 amount,
        uint256 purchaseDate,
        uint256 dueDate,
        uint256 paidAmount,
        TransactionStatus status,
        string memory orderId
    ) {
        Transaction memory txn = transactions[_transactionId];
        return (
            txn.customer,
            txn.amount,
            txn.purchaseDate,
            txn.dueDate,
            txn.paidAmount,
            txn.status,
            txn.orderId
        );
    }

    /**
     * @dev Kiểm tra giao dịch có quá hạn không
     */
    function isOverdue(uint256 _transactionId) public view returns (bool) {
        Transaction memory txn = transactions[_transactionId];
        return block.timestamp > txn.dueDate && txn.status != TransactionStatus.PAID;
    }

    /**
     * @dev Withdraw funds (chỉ owner)
     */
    function withdraw() external onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "No funds to withdraw");
        payable(owner()).transfer(balance);
    }

    /**
     * @dev Pause contract
     */
    function pause() external onlyOwner {
        _pause();
    }

    /**
     * @dev Unpause contract
     */
    function unpause() external onlyOwner {
        _unpause();
    }

    /**
     * @dev Fallback function to receive ETH
     */
    receive() external payable {}
}

